    const child = props.child;

    return(

       <div className = "mainback">
            <Container className = "mainback">
                <Row>
                    <div className = "page">

                        <h1 className = "heading">{title}</h1>
                        <hr/>
                        <div>
                    {child}
                    </div>
                    </div>
                </Row>
            </Container>
            </div>

    );


}

export default MainScreen
